import { AppBar, Toolbar } from '@mui/material';
import * as React from 'react';
import {
    Stack,
    Container,
    IconButton,
    Box,
    ImageList,
    ImageListItemBar,
    ImageListItem,
    TextField,
    ThemeProvider,
    MenuItem,
    Menu,
    Typography,
  } from "@mui/material";

  const itemData = [
    {
      img: 'https://images.unsplash.com/photo-1551963831-b3b1ca40c98e',
      title: 'Breakfast',
    },
    {
      img: 'https://images.unsplash.com/photo-1551782450-a2132b4ba21d',
      title: 'Burger',
    },
    {
      img: 'https://images.unsplash.com/photo-1522770179533-24471fcdba45',
      title: 'Camera',
    }];
  function Projects() {
    return (
      <Container
      fixed
      sx={{
        bgcolor: "transparent",
        marginTop: '10vh', 
        marginBottom: '10vh',
        width: "100%",
        height: "100vh",
        display: 'flex',
        justifyContent: 'space-between',
      }}
    >
      <Typography>Maze Game</Typography>
      <Box sx={{ mb: "10px", borderBottom: "2px solid white" }}>
        <Stack spacing={0} direction="row" sx={{ overflowX: "auto" }}>
          <ImageList
                  sx={{
                    width: "100vw", // Set a fixed width to determine the visible images
                    display: "flex",
                    flexDirection: "row",
                  }}
                  rowHeight={400}
                >
                  {itemData.slice(0, 10).map((item) => (
                    <ImageListItem
                      key={item.img}
                      sx={{
                        flex: "0 0 auto", // Allow the item to shrink but not grow
                        maxWidth: "25%", // Set the maximum width of each item
                        overflowY: "hidden",
                        margin: "0", // Add some spacing between items
                        height: "100vh",
                        "&:hover": {
                          border: "1px solid indigo",
                        },
                      }}
                    >
                      <img
                        src={`${item.img}?w=164&h=164&fit=crop&auto=format`}
                        srcSet={`${item.img}?w=164&h=164&fit=crop&auto=format&dpr=2 2x`}
                        alt={item.title}
                        loading="lazy"
                      />
              </ImageListItem>
                ))}
            </ImageList>
        </Stack>
      </Box>
    </Container>
    );
  };

  export default Projects;
